import React from 'react';
import { LogoWrapper, LogoImg, TitleWeather, TitleApp } from './Logo.styled';

import LogoImg1 from '../img/free-icon-weather-app-3845731.png';

export const Logo = () => {
  return (
    <LogoWrapper>
      {/* <div style={{ display: 'flex', alignItems: 'baseline' }}> */}
      <LogoImg src={LogoImg1} width="20" height="20" alt="Logo" />
      <TitleWeather>Weather</TitleWeather>
      <TitleApp style={{ fontSize: '20px', color: '#FFF300' }}>App</TitleApp>
      {/* </div> */}
    </LogoWrapper>
  );
};
